objects.updateScript:
function(value, item, data, components, dataObj){
  var dataObj = {
    Fault: 0,
    On: 0
  }
  dataObj = E_GetObjValue(value, item, data, components, dataObj)
  //根据得到的值进行判断
  if(Number(dataObj['Fault'])) {
    //故障黄色
    item.set({
      gateOn: false,
      stroke: '#ff0'
    })
  } else {
    if(Number(dataObj['On'])) {
      //合闸红色
      item.set({
        gateOn: true,
        stroke: '#f00'
      })
    } else {
      //分闸绿色
      item.set({
        gateOn: false,
        stroke: '#6BB93F'
      })
    }
  }
  return true
}

